import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navigation from "./components/Navigation";
import Login from "./pages/Login";

function App() {
  return (
    <div className="App">
      <Router>
        <Navigation />

        <Route path="/login" component={Login} />
      </Router>
    </div>
  );
}

export default App;
